import React from 'react';

import  { FirebaseContext } from '../Firebase';

const Account = () => (
    <FirebaseContext.Consumer>
    {firebase => {
      return <div>I've access to Firebase and render something.</div>;
    }}
  </FirebaseContext.Consumer>
);

export default Account;
